import React, {useEffect, useState} from "react";
import {Button, Footer, Navbar} from "../webcomponent";
import {Avatar, Card, CardBody, CardHeader, Progress, Typography,} from "@material-tailwind/react";
import {useNavigate} from "react-router-dom";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faStar} from "@fortawesome/free-solid-svg-icons";
import axios from "../../api/axios";

const Home = () => {

    const [books, setBooks] = useState(null);

    useEffect(() => {
        const getDetails = async () => {

            try {
                let response = await axios.get('/books?page=1&fetch=4',
                    {
                        headers: {'Content-Type': 'application/json'},
                        // withCredentials: true,

                    }
                );

                setBooks(response.data);
            } catch (error) {
                console.log(error);
            }

        }

        getDetails().then();

    }, []);

    const navigate  = useNavigate() ;


    return (

        <div className="flex flex-col justify-between items-center w-full overflow-hidden">

            <Navbar active="Home"/>



            <Footer/>

        </div>

    )

}

export default Home
